import React, { useState } from 'react';
import { useMutation } from '@tanstack/react-query';
import api from '../services/api';
import { useDispatch } from 'react-redux';
import { addMaintenance } from '../redux/slices/maintenanceSlice';
import { Maintenance } from '../redux/slices/maintenanceSlice';
import {
  Box,
  Button,
  FormControl,
  FormLabel,
  Input,
  VStack,
  Heading,
  useToast,
  Container,
  Stack,
  useBreakpointValue,
  extendTheme,
  Center,
} from '@chakra-ui/react';

// Chakra UI tema uzantısı (isteğe bağlı)
const theme = extendTheme({
  colors: {
    brand: {
      500: '#3182CE',
      600: '#2B6CB0',
    },
  },
});

const AddNew: React.FC = () => {
  const dispatch = useDispatch();
  const toast = useToast();
  const [formData, setFormData] = useState({
    buildingName: '',
    address: '',
    adminName: '',
    monthlyFee: 0,
    description: '',
  });

  const mutation = useMutation({
    mutationFn: async () => {
      const response = await api.post('/maintenance', formData);
      return response.data;
    },
    onSuccess: (data: unknown) => {
      if (data && typeof data === 'object' && 'id' in data) {
        const maintenanceData = data as Maintenance;
        dispatch(addMaintenance(maintenanceData));
        toast({
          title: 'Success',
          description: 'New maintenance added successfully',
          status: 'success',
          duration: 3000,
          isClosable: true,
        });
        window.location.href = '/';
      } else {
        console.error('Unexpected data format:', data);
      }
    },
    onError: () => {
      toast({
        title: 'Error',
        description: 'There was an error adding the maintenance.',
        status: 'error',
        duration: 3000,
        isClosable: true,
      });
    },
  });

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: name === 'monthlyFee' ? parseFloat(value) : value,
    });
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    mutation.mutate();
  };

  return (
    <Container maxW="lg" p={4} display="flex" justifyContent="center" alignItems="center" minH="100vh">
      <Box
        p={8}
        borderWidth={1}
        borderRadius="lg"
        boxShadow="xl"
        bg="white"
        overflow="hidden"
        borderColor="gray.200"
        width="100%"
      >
        <Heading as="h1" mb={6} textAlign="center" fontSize={useBreakpointValue({ base: 'xl', md: '2xl' })} color="brand.500">
          Add New Maintenance
        </Heading>
        <form onSubmit={handleSubmit}>
          <Stack spacing={5}>
            <FormControl isRequired>
              <FormLabel>Building Name</FormLabel>
              <Input
                type="text"
                name="buildingName"
                placeholder="Enter building name"
                value={formData.buildingName}
                onChange={handleChange}
                focusBorderColor="brand.500"
              />
            </FormControl>
            <FormControl isRequired>
              <FormLabel>Address</FormLabel>
              <Input
                type="text"
                name="address"
                placeholder="Enter address"
                value={formData.address}
                onChange={handleChange}
                focusBorderColor="brand.500"
              />
            </FormControl>
            <FormControl isRequired>
              <FormLabel>Admin Name</FormLabel>
              <Input
                type="text"
                name="adminName"
                placeholder="Enter admin name"
                value={formData.adminName}
                onChange={handleChange}
                focusBorderColor="brand.500"
              />
            </FormControl>
            <FormControl isRequired>
              <FormLabel>Monthly Fee</FormLabel>
              <Input
                type="number"
                name="monthlyFee"
                placeholder="Enter monthly fee"
                value={formData.monthlyFee}
                onChange={handleChange}
                focusBorderColor="brand.500"
              />
            </FormControl>
            <FormControl isRequired>
              <FormLabel>Description</FormLabel>
              <Input
                type="text"
                name="description"
                placeholder="Enter description"
                value={formData.description}
                onChange={handleChange}
                focusBorderColor="brand.500"
              />
            </FormControl>
            <Button
              type="submit"
              colorScheme="brand"
              size="lg"
              mt={4}
              width="full"
              boxShadow="md"
              _hover={{ boxShadow: 'lg' }}
              _focus={{ boxShadow: 'outline' }}
            >
              Add
            </Button>
          </Stack>
        </form>
      </Box>
    </Container>
  );
};

export default AddNew;
